$(document).ready((function(){function print_laporan(){const date=get_date_filter(),paket=$("#paket").val(),donatur=$("#donatur").val(),kolektor=$("#kolektor").val(),lunas=$("#lunas").val(),url=`${base_url}laporan/rekap_donatur/by_kolektor/print_laporan?tgl1=${date.tgl1}&tgl2=${date.tgl2}&p=${paket}&d=${donatur}&k=${kolektor}&l=${lunas}`;window.open(url,"_blank")}prepare_date_filter(),$("#tgl1, #tgl2, #paket, #donatur, #kolektor").on("keypress",(function(e){13===e.keyCode&&print_laporan()})),$(".search_icon").on("click",(function(){print_laporan()}))}));